Actionscript.script:
stop();
_root.warpframe = false;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (this.warp2.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 2;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		} else {
			_root.attachMovie("downtransition", "downtransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		warp = false;
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			_root.changecourse("lefttransition2", "3-2", 0, 1875, 0, 1875);
		} else {
			_root.Invincible = false;
			_root.Metal = false;
			_root.Invisible = false;
			_root.PowerTimer = 0;
			//
			_root.HazymazeCaveSongChange(1);
			//
			_root.changecourse("downtransition2", "3-6", 0, 0, 0, 0);
		}
		//_root.warpframe = false;            
	}
};

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body)) {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom>75) {
				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body)) {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom>75) {
				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (_root.PauseGame == false && _root.playpause == false) {
		if (this.hitTest(_root.Course.Char.charClip.feet)) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			//_root.Course.Char.yspeed -= 0.5;
			_root.Course.Char.hurtfallcount = 0;
		}
	}
}

onClipEvent (load) {
	//example   = "You can jump in the cannon\nand blast off!";
	signmessage = "Carpet Instructions:\n1) Stand atop the Carpet\n2) Stay on the Carpet\n3) Access New Locations and Items";
}

onClipEvent (load) {
	//example   = "You can jump in the cannon\nand blast off!";
	signmessage = "Hazy Maze Cave\nSide Room";
}

onClipEvent (load) {
	//example   = "You can jump in the cannon\nand blast off!";
	signmessage = "DANGER!\n\nToxic Maze Below";
}

onClipEvent (load) {
	picture = true;
	if (_root.Starnum == 4) {
		signmessage = "3mrc";
	} else {
		signmessage = "3m2";
	}
}

onClipEvent (load) {
	invis = true;
	starnum = 14;
	timecount = 0;
	//
	if (_root.Course.coincountnum == undefined) {
		_root.Course.coincountnum = 0;
	} else {
		_root.Course.coincountnum++;
	}
	if (_root["coindata"+_root.playingcourse][0] == undefined) {
		_root["coindata"+_root.playingcourse] = [""];
	}
	coinnum = _root.Course.coincountnum;
	if (_root["coindata"+_root.playingcourse][coinnum] == 1) {
		invis = false;
	}
}
onClipEvent (enterFrame) {
	timecount++;
	if (_root.RedCoins>=8 && timecount>12) {
		_root["coindata"+_root.playingcourse][coinnum] = 1;
		invis = false;
	}
}
